CREATE TABLE `usuario` (
  `usua_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '{"user-control":"hidden"}',
  `usua_nome` varchar(200) CHARACTER SET utf8 NOT NULL COMMENT '{"user-control":"text", "required":"yes"}',
