  `usua_celular` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '{"user-control":"text", "required":"yes", "typeof":"phone"}',
  PRIMARY KEY (`usua_id`),
  UNIQUE KEY `usua_email` (`usua_email`)
